import styled from "styled-components";

const ProductsWrap = styled.div`
  background-color: #fbf0f4;
  padding-bottom: 20px;

  .products-section {
    padding: 20px;
    display: flex;
    flex-wrap: wrap;
    justify-content: space-between;
  }
`;

export { ProductsWrap };
